import PropTypes from 'prop-types';
import { Component } from 'react';

export class Feedback extends Component {
  state = {
    good: 0,
    neutral: 0,
    bad: 0,
  };

  countTotalFeedback = () => {};

  countPositiveFeedbackPercentage = () => {};

  render() {
    return (
      <div className="main_container">
        <h1 className="feedback_titl">Please leave feedback</h1>
        <div className="btn_container">
          <button className="btn">Good</button>
          <button className="btn">Netural</button>
          <button className="btn">Bad</button>
        </div>
        <h2 className="statistic_titl">Statistics</h2>
        <p className="statistic_text">
          Neutral: <span className="statistic_result">0</span>
        </p>
        <p className="statistic_text">
          Good: <span className="statistic_result">0</span>
        </p>
        <p className="statistic_text">
          Bad: <span className="statistic_result">0</span>
        </p>
        <p className="statistic_text">
          Total: <span className="statistic_result">0</span>
        </p>
        <p className="statistic_text">
          Positive feedback: <span className="statistic_result">0</span>
        </p>
      </div>
    );
  }
}
